import React from 'react';
import { BrowserRouter, Route, Link } from "react-router-dom";

function App() {
	return (
		<BrowserRouter>
			<Route path="/" exact>
				<div className="bg-gray-900 min-h-screen flex flex-col justify-center">
					<div className="bg-gray-700 px-10 py-10 mx-auto text-center">
						<h1 className="text-5xl text-white font-extralight mb-3">Drop here to upload</h1>
						<h3 className="text-2xl text-gray-400 mb-10 font-light">or click to select a file...</h3>
					</div>
				</div>
			</Route>
		</BrowserRouter>

	);
}

export default App;
